import { View, Text, Image, FlatList } from "react-native";

const faceData = [
  {
    id: "1",
    title: "Kitty",
    price: "$40.00",
    image: require("../images/kitty.jpg"),
  },
  {
    id: "2",
    title: "Kitty",
    price: "$40.00",
    image: require("../images/beats.jpeg"),
  },
];
export default function Product() {
  const renderItem = () => {
    <View
      style={{ height: 200, width: 200, backgroundColor: "red", left: 30 }}
    ></View>;
  };

  return <View></View>;
}
